const seen = new Set();

function getRndInteger(min, max) {
    return Math.floor(Math.random() * (max - min)) + min;
}

function split_to_chunks(str, chunk_size) {
    const chunk_inds = Array.from(Array(str.length / chunk_size).keys());
    return chunk_inds.map(function (i) { return str.slice(i * chunk_size, (i + 1) * chunk_size) });
}

function calculate_choice(date) {
    let todays_choice = "";
    const [day, month, year] = date.split('.').map(function (x) { return parseInt(x); });
    const start_ts = new Date(2022, 0, 1).getTime();
    const date_ts = new Date(year, month - 1, day).getTime();
    const day_number = Math.round((date_ts - start_ts) / 86400000);
    const ind = (day_number * 5) % CONCAT_CHOICES.length;
    todays_choice = CONCAT_CHOICES.slice(ind, ind + 5);
    // words used in prev games
    if (!seen.has(todays_choice)) {
        seen.add(todays_choice);
    }
    return todays_choice;
}


